        return(

            <div class='post-container'>
                <div class='post-header'>
                    <h2>Post </h2>
                </div>
                <hr/>
                <div class='post-content'>
                <SinglePost title='Post 1' description='post description 1'/> 
              <SinglePost title='Post 2' description='post description 2'/> 
                </div>

            </div>
        );
    }
}

export default Post
